import React, { useState, useEffect } from 'react';
import  axios  from 'axios';
import { Link } from 'react-router-dom';

export default function RecipeList() {
  const [recipes, setRecipes] = useState([])

  useEffect(function(){
    async function getRecipes(){
      try {
        const response = await axios.get("http://localhost:3001/api/recipes")
        setRecipes(response.data)
      } catch(error) {
        console.log('error', error)
      }
    }
    getRecipes()
  },[])
  return (
    <div className="RecipeList">
      <h2>
        Recipes
        <button className="mdc-button mdc-button--raised">
          <Link className="mdc-button__label" to="/recipes/new">Create Recipe</Link>
        </button>        
      </h2>
      <hr/>
      <div className='container'>
      {recipes.map((recipe) => {
        return(          
          <div className="mdc-card" key={recipe._id}>
            <div className="my-card__media mdc-card__media mdc-card__media--16-9">
              <div className="mdc-card__media-content">Title</div>
            </div>
            <div className="mdc-card__content">
              <h4>{recipe.title}</h4>
              <h5>Insert extra stuff here</h5>

            <h4><Link to={`/recipes/${recipe._id}`}>{recipe.title}</Link></h4>
            <small>_id: {recipe._id}</small>
            </div>
          </div>          
        )     
      })}
      </div>
    </div>
  )
}
